import React, { useEffect } from 'react';
import $ from 'jquery';
import 'bootstrap/dist/css/bootstrap.min.css';

function HomePage() {
    useEffect(() => {
        $('[data-spy="scroll"]').each(function () {
            var $spy = $(this).scrollspy('refresh');
        });

        window.initMap = function() {
            // CÃ³digo para inicializar el mapa de Google
        };
    }, []);

    return (
        <div>
            <nav className="custom-navbar navbar navbar-expand-lg navbar-dark fixed-top" data-spy="affix" data-offset-top="10">
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <a className="nav-link" href="#home">Home</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#about">About</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#gallary">Gallary</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#book-table">Book-Table</a>
                        </li>
                    </ul>
                    <a className="navbar-brand m-auto" href="#">
                        <img src={process.env.PUBLIC_URL + '/assets/imgs/logo.svg'} className="brand-img" alt="" />
                        <span className="brand-txt">Food Hut</span>
                    </a>
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <a className="nav-link" href="#blog">Blog<span className="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#testmonial">Reviews</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#contact">Contact Us</a>
                        </li>
                        <li className="nav-item">
                            <a href="components.html" className="btn btn-primary ml-xl-4">Components</a>
                        </li>
                    </ul>
                </div>
            </nav>
            <header id="home" className="header">
                <div className="overlay text-white text-center">
                    <h1 className="display-2 font-weight-bold my-3">Food Hut</h1>
                    <h2 className="display-4 mb-5">Always fresh &amp; Delightful</h2>
                    <a className="btn btn-lg btn-primary" href="#gallary">View Our gallary</a>
                </div>
            </header>
            {/* Resto del contenido del index */}
            {/* AsegÃºrate de ajustar las rutas de los recursos segÃºn la estructura de tu proyecto */}
        </div>
    );
}

export default HomePage;
